import { defineMessages } from 'react-intl';

export const scope = 'app.containers.branchDashboard';

export default defineMessages({
  branch: {
    id: `${scope}.branch`,
    defaultMessage: 'Branch',
  },
  branches: {
    id: `${scope}.branches`,
    defaultMessage: 'Branches',
  },
  reports: {
    id: `${scope}.reports`,
    defaultMessage: 'Reports',
  },
  branchAddition: {
    id: `${scope}.branchAddition`,
    defaultMessage: 'Branch Addition',
  },
  networkErrorTitle: {
    id: `${scope}.networkErrorTitle`,
    defaultMessage: 'No internet connection!',
  },
  networkErrorMessage: {
    id: `${scope}.networkErrorMessage`,
    defaultMessage: 'No internet connection!',
  },
  serverErrorMessage: {
    id: `${scope}.serverErrorMessage`,
    defaultMessage: '500 Something went wrong!',
  },
  serverErrorTitle: {
    id: `${scope}.serverErrorTitle`,
    defaultMessage: '500 Something went wrong!',
  },


});
